import React, { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import { logOut } from '../../actions/auth';
const LogOut = () => {

  const dispatch = useDispatch();

  useEffect(() => {
    dispatch(logOut);
  });

  return (
    <div>Log out</div>
  )
}

export default LogOut;
